import React from 'react';


 class Commande extends React.Component {
    toggle() {
        this.setState(prevState => ({
          modal: !prevState.modal
        }));
      }
    render() {    
        const {reservation} = this.props 
     return(
        <div>
            <li>{reservation.name} {reservation.surname} </li>
        </div>
     )
    }
 }

export default Commande
